package Saturday_Lab1.Que_5;import java.util.Scanner;public class TestMain {    public static void main(String[] args) {        Scanner sc = new Scanner(System.in);        Ticket t = new Ticket();        System.out.println("Enter Available Tickets:");        int at = sc.nextInt();        Ticket.setAvailableTickets(at);        System.out.println("Enter Ticket ID:");        int tid = sc.nextInt();        t.setTicketId(tid);        System.out.println("Enter Price :");        int p = sc.nextInt();        t.setPrice(p);        System.out.println("Enter No of Tickets to be Book:");        int tb = sc.nextInt();        int cost = t.calculateTotalCost(tb);        if(cost == -1) {            System.out.println("Tickets are not available");        }        else {            System.out.println("Available Tickets:"+Ticket.getAvailableTickets());            System.out.println("Total Cost:"+cost);        }    }}